const infected = "Infected";
const recovered = "Recovered";
const deaths = "Deaths";
const numberActiveCasesCovid = "Number of active cases of COVID-19";
const numberRecoveriesCovid = "Number of recoveries from COVID-19";
const numberDeathsCovid = "Number of deaths caused by COVID-19";
const selectCountry = "Select a country ...";
const people = "People";

export default {
  infected,
  recovered,
  deaths,
  numberActiveCasesCovid,
  numberRecoveriesCovid,
  numberDeathsCovid,
  selectCountry,
  people,
};
